import ReactDOM from 'react-dom';
import Navbar from "./navbar"
import Nxt from "./nxt"
import Inter from "./inter"
import Adder from "./adder"


function App(){

let n=false;
let m=0;

function get(val,id){
    n = val,m= id;
}

  return <div>
<Navbar zero={n} ind={m} />
<Nxt />
<Inter 
    tot={get}
/>

  </div>
}
 

export default App
